import Cart from "./cart/cart";
import Main from "./Main/Main";
import Item from "./Item/Item";
import data from "../MOCK_DATA.json"
import './App.css';


const App = props => [
  <Nav key={1} />,
  <Routes key={2} />
]

const Routes = props => {
  <Switch>
    <Route exact path="/" Component={Main} />
    <Route exact path="/cart" Component={Cart} />
